pragma solidity >=0.4.21 <0.6.0;


library SafeMath {

    function add(uint a, uint b) internal pure returns (uint c) {

        c = a + b;

        require(c >= a);

    }

    function sub(uint a, uint b) internal pure returns (uint c) {

        require(b <= a);

        c = a - b;

    }

    function mul(uint a, uint b) internal pure returns (uint c) {

        c = a * b;

        require(a == 0 || c / a == b);

    }

    function div(uint a, uint b) internal pure returns (uint c) {

        require(b > 0);

        c = a / b;

    }

}

library ExtendedMath {


    //return the smaller of the two inputs (a or b)
    function limitLessThan(uint a, uint b) internal pure returns (uint c) {

        if(a > b) return b;

        return a;

    }
}

contract Owned {

    address public owner;

    address public newOwner;


    event OwnershipTransferred(address indexed _from, address indexed _to);


    constructor() public {

        owner = msg.sender;

    }


    modifier onlyOwner {

        require(msg.sender == owner);

        _;

    }


    function transferOwnership(address _newOwner) public onlyOwner {

        newOwner = _newOwner;

    }

    function acceptOwnership() public {

        require(msg.sender == newOwner);

       emit OwnershipTransferred(owner, newOwner);

        owner = newOwner;

        newOwner = address(0);

    }

}



contract HunterLabsToken3 is Owned{

    using SafeMath for uint;
    using ExtendedMath for uint;

	string public name = 'Hunterlabs Token';
	string public symbol = 'HLT';
	string public standard = 'Hunterlabs Token v2.0';
    uint8 public decimals = 8;
	uint public totalSupply = 10 * 10**uint(decimals) ;
    uint public circulatingSupply;
    uint one = 1;
    uint public latestDifficultyPeriodStarted;
    uint public epochCount;//number of 'blocks' mined
    uint public _BLOCKS_PER_READJUSTMENT = 1024;
    uint public _BLOCKS_PER_READJUSTMENT_OF_SUPPLY = 10;

    uint public _INFLATION_RATE = 100;
    uint public _INFLATION_RATE_BASIS = 1000;

    uint public reward_pool_cut = 0;
    uint public z_holders_cut = 0;
    uint public miners_cut = 0;
    uint public reward_amount = totalSupply.mul(10).div(100);

    uint public reward_pool_cut_pct = one.mul(75).div(100);
    uint public z_holders_cut_pct = one.mul(15).div(100);
    uint public miners_cut_pct = one.mul(10).div(100);

    uint public  _MINIMUM_TARGET = 2**16;
    uint public  _MAXIMUM_TARGET = 2**234;
    uint public miningTarget;
    uint public  _MINIMUM_DIFFICULTY = 1;
    uint public  _MAXIMUM_DIFFICULTY = 54;
    bool locked = false;
    uint public miningDifficulty; //adjusts every 2016 epochs (or blocks)
    bytes32 public challengeNumber;   //generate a new one when a new reward is minted
    uint public rewardEra;
    uint public maxSupplyForEra;
    address public lastRewardTo;
    uint public lastRewardAmount;
    uint public lastRewardEthBlockNumber;
    uint public tokensMinted;

	//transfer 
    mapping(bytes32 => bytes32) solutionForChallenge;
    mapping(address => uint256) public balanceOf;
    mapping(address => uint256) public balanceOfRewardPool;
    mapping(address => uint256) public balanceOfVesting;
    mapping(bytes32 => uint) rewardHashesFound; //the hash and the nonce
    //allowance
    mapping(address => mapping(address=>uint256)) public allowance;

	event Transfer(
        address indexed _from,
        address indexed _to,
        uint256 _value
    );

    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );
    event Mint(address indexed from, 
        uint reward_amount, 
        uint epochCount, 
        bytes32 newChallengeNumber);

	constructor(uint256 _initialSupply) public {                  

        // balanceOf[msg.sender] = _initialSupply;
        // totalSupply = _initialSupply;   
        // minter = msg.sender;

        // totalSupply = 21000000 * 10**uint(decimals);
        // totalSupply = 21 * 10 ** uint(decimals);
        // totalSupply = 100;

        if(locked) revert();
        locked = true;

        tokensMinted = 0;

        rewardEra = 0;

        circulatingSupply = 0;

        // miningDifficulty = _MINIMUM_DIFFICULTY;
        miningTarget = _MAXIMUM_TARGET;

        latestDifficultyPeriodStarted = block.number;

        _startNewMiningEpoch();
    }

    function transfer(address _to, uint256 _value) public returns (bool success){

    	require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        emit Transfer( msg.sender , _to, _value);
        return true;
    }

    //approve

    function approve(address _spender,uint256 _value) public returns(bool success){
        //allowance
        allowance[msg.sender][_spender] =  _value;
        emit Approval(msg.sender,_spender,_value);
        return true;

    }

    function transferFrom(address _from,address _to,uint256 _value) public returns (bool success){

        require(_value<=balanceOf[_from]);
        require(_value <= allowance[_from][msg.sender]); 
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        emit Transfer(_from,_to,_value);
        return true;

    }

   function _startNewMiningEpoch() internal {

      //if max supply for the era will be exceeded next reward round then enter the new era before that happens

      //40 is the final reward era, almost all tokens minted
      //once the final era is reached, more tokens will not be given out because the assert function
      // if( tokensMinted.add(getMiningReward()) > maxSupplyForEra)
      // {
      //   rewardEra = rewardEra + 1;
      // }

      //set the next minted supply at which the era will change
      // total supply is 2100000000000000  because of 8 decimal places
      // maxSupplyForEra = totalSupply;

      epochCount = epochCount.add(1);

      //every so often, readjust difficulty. Dont readjust when deploying
      if(epochCount % _BLOCKS_PER_READJUSTMENT == 0)
      {
        _reAdjustDifficulty();
      }

      if(epochCount % _BLOCKS_PER_READJUSTMENT_OF_SUPPLY == 0){

            if ( _INFLATION_RATE >= 10){
                _INFLATION_RATE = _INFLATION_RATE.sub(one);
            }

        _reAdjustSupply();

      }

      //make the latest ethereum block hash a part of the next challenge for PoW to prevent pre-mining future blocks
      //do this last since this is a protection mechanism in the mint() function
      challengeNumber = blockhash(block.number - 1);
    }

    function _reAdjustSupply() internal {

        totalSupply = circulatingSupply;
        circulatingSupply = circulatingSupply.add(circulatingSupply.mul(_INFLATION_RATE).div(_INFLATION_RATE_BASIS));
        totalSupply = circulatingSupply - totalSupply;
    }

    function _reAdjustDifficulty() internal {


        uint ethBlocksSinceLastDifficultyPeriod = block.number - latestDifficultyPeriodStarted;
        //assume 360 ethereum blocks per hour

        //we want miners to spend 10 minutes to mine each 'block', about 60 ethereum blocks = one 0xbitcoin epoch
        uint epochsMined = _BLOCKS_PER_READJUSTMENT; //256

        // uint targetEthBlocksPerDiffPeriod = epochsMined * 60; //should be 60 times slower than ethereum
        uint targetEthBlocksPerDiffPeriod = epochsMined; //should be 60 times slower than ethereum

        //if there were less eth blocks passed in time than expected
        if( ethBlocksSinceLastDifficultyPeriod < targetEthBlocksPerDiffPeriod )
        {
          uint excess_block_pct = (targetEthBlocksPerDiffPeriod.mul(100)).div( ethBlocksSinceLastDifficultyPeriod );

          uint excess_block_pct_extra = excess_block_pct.sub(100).limitLessThan(1000);
          // If there were 5% more blocks mined than expected then this is 5.  If there were 100% more blocks mined than expected then this is 100.

          //make it harder
          miningTarget = miningTarget.sub(miningTarget.div(2000).mul(excess_block_pct_extra));   //by up to 50 %
        }else{
          uint shortage_block_pct = (ethBlocksSinceLastDifficultyPeriod.mul(100)).div( targetEthBlocksPerDiffPeriod );

          uint shortage_block_pct_extra = shortage_block_pct.sub(100).limitLessThan(1000); //always between 0 and 1000

          //make it easier
          miningTarget = miningTarget.add(miningTarget.div(2000).mul(shortage_block_pct_extra));   //by up to 50 %
        }


        latestDifficultyPeriodStarted = block.number;

        if(miningTarget < _MINIMUM_TARGET) //very difficult
        {
          miningTarget = _MINIMUM_TARGET;
        }

        if(miningTarget > _MAXIMUM_TARGET) //very easy
        {
          miningTarget = _MAXIMUM_TARGET;
        }
    }


    function getMintDigest(uint256 nonce, bytes32 challenge_digest, bytes32 challenge_number) public view returns (bytes32 digesttest) {

        bytes32 digest = keccak256(abi.encodePacked(challenge_number,msg.sender,nonce));
        return digest;

      }

      function checkMintSolution(uint256 nonce, bytes32 challenge_digest, bytes32 challenge_number, uint testTarget) public view returns (bool success) {

          bytes32 digest = keccak256(abi.encodePacked(challenge_number,msg.sender,nonce));

          if(uint256(digest) > testTarget) revert();

          return (digest == challenge_digest);

        }


function mint(uint256 nonce, bytes32 challenge_digest) public returns (bool success) {

            //the PoW must contain work that includes a recent ethereum block hash (challenge number) and the msg.sender's address to prevent MITM attacks
            bytes32 digest =  keccak256(abi.encodePacked(challengeNumber, msg.sender, nonce));

            //the challenge digest must match the expected
            if (digest != challenge_digest) revert();

            //the digest must be smaller than the target
            if(uint256(digest) > miningTarget) revert();


            //only allow one reward for each challenge
            bytes32 solution = solutionForChallenge[challengeNumber];
            solutionForChallenge[challengeNumber] = digest;
            if(solution != 0x0) revert();  //prevent the same answer from awarding twice

            reward_amount = getMiningReward();

            miners_cut = reward_amount.mul(10).div(100);
            reward_pool_cut = reward_pool_cut.add(reward_amount.mul(75).div(100));
            z_holders_cut = z_holders_cut.add(reward_amount.mul(15).div(100));

            balanceOfRewardPool[address(this)] = balanceOfRewardPool[address(this)].add(reward_pool_cut);
            balanceOfVesting[address(this)] = balanceOfVesting[address(this)].add(z_holders_cut);
            balanceOf[msg.sender] = balanceOf[msg.sender].add(miners_cut);

            tokensMinted = tokensMinted.add(reward_amount);
            circulatingSupply = circulatingSupply + tokensMinted;

            //Cannot mint more tokens than there are
            // assert(tokensMinted <= maxSupplyForEra);
            //set readonly diagnostics data

            lastRewardTo = msg.sender;
            lastRewardAmount = miners_cut;
            lastRewardEthBlockNumber = block.number;

             _startNewMiningEpoch();

           emit Mint(msg.sender, reward_amount, epochCount, challengeNumber );

           return true;

        }

    //this is a recent ethreum block hash, used to prevent pre-mining future blocks
    function getChallengeNumber() public view returns (bytes32) {
        return challengeNumber;
    }

    //the number of zeroes the digest of the PoW solution requires.  Auto adjusts
     function getMiningDifficulty() public view returns (uint) {
         return _MAXIMUM_TARGET.div(miningTarget);
    }

    function getMiningTarget() public view returns (uint) {
       return miningTarget;
    }

    function getMiningReward() public view returns (uint) {
        return totalSupply.mul(10).div(100);
    }

    function getTotalSupply() public view returns (uint) {
        return totalSupply;
    }

    // ------------------------------------------------------------------------

    // Don't accept ETH

    // ------------------------------------------------------------------------

    function () external payable {

        revert();

    }


}
